 import './App.css';
 import Homepages from './components/directory/directory';
 import { Route ,Switch , Link} from "react-router-dom";

 const Hatpage = (props) => {
   console.log(props);
   return (
     <div>
       <h1>
         Hello this is Hatpage
       </h1>
     </div>
   )
 }



function App() {

  return (
    <div>
      <Switch>
      <Route exact path="/" component={ Homepages }/>
      <Route  exact path="/shop/hats" component={ Hatpage }/>
      </Switch>
    </div>
  )
}

export default App;
